import { useState } from 'react'
import '../stylesheets/Profile.css';
import Back from './BackButton';

function SettingsPage() {

    const data = 
        {
            id: 1,
            nameFirst: 'Gunner',
            nameLast: 'Peterson',
            address: '14 Old Farm Road',
            phone:'7814921706',
            isDriver:true,
            email: 'Gunnerpeterson14@gmail.com',
            ridesGiven:0,
            ridesTaken:0,
        }
    if(localStorage.getItem('userData') != null){ 
    const data = JSON.parse(localStorage.getItem('userData'))
    }

    return(
        <div className="settings-wrapper">
            <div className="form-inner">
            <div className="button-header">
            <Back />
            </div>
           <div className="settings-title">
               <h2>Settings</h2>
            </div>
           </div>
           <div className="settings-info-wrapper">
            <div>
                <h2 className="phone-label">Phone Number: {data.phone}</h2>
                <h2 className="address-label">Address: {data.address}</h2>
                <h2 className="status-label">You are a: {data.isDriver ? (
                <text>Driver</text>) : (<text>Passenger</text>
                )}</h2>
            </div>
           </div>
        </div>
    )
}

export default SettingsPage
